  [],\n\t\"revision_timestamp\": \"2016-07-27T22:21:13.428254\",\n\t\"name\": \"1989-annual-water-management-report-1990-annual-water-management-plan-ruby-lake-national-w\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Ruby Lake NWR 1989 Annual Water Management
  Report 1990 Annual Water Management Plan. Includes 1989 weather summary, water availability
  forecast, summary of 1989 water levels, effects of 1989 water levels on ecology
  of each management unit, and objectives. Precipitation the last five years (1985-1989)
  has been below the 12.85 inch 49-year average. During 1988 and 1989, only 9.26 and
  9.36 inches of precipitation were received. With these low amounts in addition to
  poor surface and ground water storage from the previous below normal years, it is
  believed water shortages will continue to be extreme. Comparing this sequence of
  precipitation levels with amounts prior to 1961 when water shortages resulted in
  the South Sump decreasing in size to 20 acres, it appears to be similar, if not
  worse. During 1958 and 1959, only 7.70 and 9.76 inches of precipitation were received.
  Despite an above average precipitation year in 1960, the South Sump reached its
  lowest level during the summer of 1961. Precipitation received from November through
  February during the winters of 1956-57 to 1960-61 were below the 5.14 inch average.
  Snow pack on the mountains has been considered the most important moisture supplying
  spring flows. Precipitation during recent winters has not been low in consecutive
  years with 1985-86 and 1987-88 winters above and at the 48-year average. This may
  lessen the impact of the overall lack of moisture.\",\n\t\"license_title\": \"License
